import React, { Component } from 'react';
import '../App.css';
import ListaJogadoras from './ListaJogadoras';


export default class Escalacao extends Component {
	constructor(props) {
		super(props);

		this.state = {
			esquema: "4-3-3",
			esquema433: ["GOL", "LAT", "ZAG", "ZAG", "LAT", "MEI", "MEI", "MEI", "ATA", "ATA", "ATA"],
			esquema343: ["GOL", "ZAG", "ZAG", "ZAG", "MEI", "MEI", "MEI", "MEI", "ATA", "ATA", "ATA"],
			esquema442: ["GOL", "LAT", "ZAG", "ZAG", "LAT", "MEI", "MEI", "MEI", "MEI", "ATA", "ATA"],
			formacao: ["GOL", "LAT", "ZAG", "ZAG", "LAT", "MEI", "MEI", "MEI", "ATA", "ATA", "ATA"],
		};
		this.setEsquema = this.setEsquema.bind(this);
		this.setFormacao = this.setFormacao.bind(this);
	}

	setEsquema() {
		const selectFormacao = document.getElementById("selectFormacao");

		console.log('selectFormacao.value dentro do setEsquema ' + selectFormacao.value);

		//this.setState({ esquema: selectFormacao.value });

		this.setState({ esquema: selectFormacao.value }, () =>{
			console.log('esquema antes do setFormacao ' + this.state.esquema);
			this.setFormacao();
		});


	}

	setFormacao() {

		console.log('esquema dentro do setFormacao ' + this.state.esquema);

		console.log('formacao antes do if ' + this.state.formacao);
		console.log('foramcao após if ' + this.state.formacao);

		if (this.state.esquema === "4-3-3"){
			this.setState({formacao: this.state.esquema433}, () =>{
				console.log('foramcao após if ' + this.state.formacao);
			});
		}	else if (this.state.esquema === "4-4-2"){
			this.setState({formacao: this.state.esquema442}, () =>{
				console.log('foramcao após if ' + this.state.formacao);
			});
		}
		else if (this.state.esquema === "3-4-3"){
			this.setState({formacao: this.state.esquema343}, () =>{
				console.log('foramcao após if ' + this.state.formacao);
			});
		}

	}

	render() {
		const { formacao } = this.state.formacao;

		return (

			<div className="m-5">

				<div className="header m-5">
					<h1>Escalação</h1>
				</div>

				<div className="form-inline">
					<label>
						Formação
          	<select id="selectFormacao" className="custom-select m-2" value={this.state.esquema} onChange={this.setEsquema}>
							<option value="4-3-3">4-3-3</option>
							<option value="4-4-2">4-4-2</option>
							<option value="3-4-3">3-4-3</option>
						</select>
					</label>
				</div>


				<div>
					<table className="table my-3 mx-auto">
						<thead>
							<tr>
								<th scope="col">Posição</th>
								<th scope="col">Time</th>
								<th scope="col">Jogadora</th>
								<th scope="col"></th>
							</tr>
						</thead>
						<tbody>
							{this.state.formacao.map((posicao) => (
									<tr>
										<td>{posicao}</td>
										<td></td>
										<td></td>
										<td>
											<div className="btn btn-success btnPlus">+</div>
										</td>
									</tr>
								))}
						</tbody>
					</table>
				</div>
				<hr className="my-4" />
				<div>
					<ListaJogadoras />
				</div>

			</div>

		);
	}
}
